    }else if(err == dateFormatErr){
        console.error(dateFormatErr.err(input));
        console.info(dateFormatErr.help);
        return;
    }else if(err == sameErr){
        console.error(sameErr.err);
        console.info(sameErr.help);
        return;
    }

}

